function Form() {
  return (
    <form>
      <div>
        <input type='text' placeholder='Source' name='source' />
      </div>
      <input type='text' placeholder='Destination' name='destination' />
      <input type='date' placeholder='select Date' name='date' />
    </form>
  )
}

export default Form
